create table perros (
                        idPerro INT,
                        nombre VARCHAR(50),
                        tamanio VARCHAR(7),
                        condicionMedica VARCHAR(22),
                        edadEstimadaLlegadaMeses INT,
                        fechaLlegada DATE,
                        sexo VARCHAR(6),
                        historia TEXT,
                        estado VARCHAR(10),
                        personalidad VARCHAR(9),
                        raza VARCHAR(13)
);
